    <div className="App">
      {/* Image de fond */}
      <img className="full-screen-image" src={climbingImage} alt="Climbing App Frontpage" />

      {/* Boutons superpos√©s */}
      <div className="overlay">
        <a href="https://example.com/climbers" className="clickable-block">
          <h2>Explore Climbers</h2>
